import React, { Component, Fragment } from 'react';
import { Header } from './Contact.styled.js';

class Contact extends Component {
  render() {
    return (
      <Fragment id="contact">
        <Header>Interested in learning more? Let's chat!</Header>
      </Fragment>
    );
  }
}

export default Contact;
